        >
          {/* <div
            style={{
              background: `url(${logo}) no-repeat center center`,
              backgroundSize: 'contain',
              height: 200,
              marginBottom: 20,
              width: '85%',
            }}
          /> */}
          <SigninForm />
        </div>
      </Grid>
    </Grid>
  </S.AuthPageContainer>
);

export default SigninPage;
